INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (526,NULL,'2017-09-27 09:59:39.555000',NULL,NULL,' A code specifying the particular kind of Act that the Act-instance represents within its class.  Constraints: The kind of Act (e.g. physical examination, serum potassium, inpatient encounter, charge financial transaction, etc.) is specified with a code from one of several, typically external, coding systems.  The coding system will depend on the class of Act, such as LOINC for observations, etc. Conceptually, the Act.code must be a specialization of the Act.classCode. This is why the structure of ActClass domain should be reflected in the superstructure of the ActCode domain and then individual codes or externally referenced vocabularies subordinated under these domains that reflect the ActClass structure. Act.classCode and Act.code are not modifiers of each other but the Act.code concept should really imply the Act.classCode concept. For a negative example, it is not appropriate to use an Act.code \"potassium\" together with and Act.classCode for \"laboratory observation\" to somehow mean \"potassium laboratory observation\" and then use the same Act.code for \"potassium\" together with Act.classCode for \"medication\" to mean \"substitution of potassium\". This mutually modifying use of Act.code and Act.classCode is not permitted.',NULL,'v3 Code System ActCode',1,'ValueSet/v3-ActCode',NULL,'http://hl7.org/fhir/ValueSet/v3-ActCode',222);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (527,NULL,'2017-09-27 09:59:39.573000',NULL,NULL,' A qualitative measure of the degree of exposure to the causative agent.  This includes concepts such as \"low\", \"medium\" and \"high\".  This quantifies how the quantity that was available to be administered to the target differs from typical or background levels of the substance.',NULL,'v3 Code System ActExposureLevelCode',1,'ValueSet/v3-ActExposureLevelCode',NULL,'http://hl7.org/fhir/ValueSet/v3-ActExposureLevelCode',409);
