INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (578,NULL,'2017-09-27 09:59:40.574000',NULL,NULL,' In the United States, federal standards for classifying data on ethnicity determine the categories used by federal agencies and exert a strong influence on categorization by state and local agencies and private sector organizations. The federal standards do not conceptually define ethnicity, and they recognize the absence of an anthropological or scientific basis for ethnicity classification.  Instead, the federal standards acknowledge that ethnicity is a social-political construct in which an individual''s own identification with a particular ethnicity is preferred to observer identification.  The standards specify two minimum ethnicity categories: Hispanic or Latino, and Not Hispanic or Latino.  The standards define a Hispanic or Latino as a person of \"Mexican, Puerto Rican, Cuban, South or Central America, or other Spanish culture or origin, regardless of race.\" The standards stipulate that ethnicity data need not be limited to the two minimum categories, but any expansion must be collapsible to those categories.  In addition, the standards stipulate that an individual can be Hispanic or Latino or can be Not Hispanic or Latino, but cannot be both.',NULL,'v3 Code System Ethnicity',1,'ValueSet/v3-Ethnicity',NULL,'http://hl7.org/fhir/ValueSet/v3-Ethnicity',400);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (579,NULL,'2017-09-27 09:59:40.584000',NULL,NULL,' Code for the mechanism by which the exposure agent was exchanged or potentially exchanged by the participants involved in the exposure.',NULL,'v3 Code System ExposureMode',1,'ValueSet/v3-ExposureMode',NULL,'http://hl7.org/fhir/ValueSet/v3-ExposureMode',455);
