INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (582,NULL,'2017-09-27 09:59:40.647000',NULL,NULL,'  Description: Coded concepts representing Binding Realms (used for Context Binding of terminology in HL7 models)  and/or Namespace Realms (used to help ensure unique identification of HL7 artifacts). This code system is partitioned into three sections: Affiliate realms, Binding realms and Namespace realms.  All affiliate realm codes may automatically be used as both binding realms and namespace realms.  Furthermore, affiliate realms are the only realms that have authority over the creation of binding realms.  (Note that ''affiliate'' includes the idea of both international affiliates and the HL7 International organization.)  All other codes must be associated with an owning affiliate realm and must appear as a specialization of _BindingRealm or _NamespaceRealm.  For affiliates whose concepts align with nations, the country codes from ISO 3166-1 2-character alpha are used for the code when possible so these codes should not be used for other realm types.  It is recommended that binding realm and namespace codes submitted by affiliates use the realm code as a prefix to avoid possible collisions with ISO codes.  However, tooling does not currently support namepace realm codes greater than 2 characters.  Open Issue: The name of the concept property \"owningAffiliate\" should be changed to better reflect that the property value is the human readable name of the organizational entity that manages the Realm identified by the Realm Code.  Open Issue: In spite of the inability of tooling to process codes longer than 2 characters, there is at least one realm codes (''SOA'') that was added that is 3 characters in length.',NULL,'v3 Code System hl7Realm',1,'ValueSet/v3-hl7Realm',NULL,'http://hl7.org/fhir/ValueSet/v3-hl7Realm',457);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (583,NULL,'2017-09-27 09:59:40.665000',NULL,NULL,' The possible modes of updating that occur when an attribute is received by a system that already contains values for that attribute.',NULL,'v3 Code System HL7UpdateMode',1,'ValueSet/v3-HL7UpdateMode',NULL,'http://hl7.org/fhir/ValueSet/v3-HL7UpdateMode',458);
