INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (625,NULL,'2017-09-27 09:59:42.062000',NULL,NULL,' Codes for the Role class hierarchy.  The values in this hierarchy, represent a Role which is an association or relationship between two entities - the entity that plays the role and the entity that scopes the role.  Roles names are derived from the name of the playing entity in that role. The role hierarchy stems from three core concepts, or abstract domains:    RoleClassOntological is an abstract domain that collects roles in which the playing entity is defined or specified by the scoping entity.   RoleClassPartitive collects roles in which the playing entity is in some sense a \"part\" of the scoping entity.   RoleClassAssociative collects all of the remaining forms of association between the playing entity and the scoping entity. This set of roles is further partitioned between:    RoleClassPassive which are roles in which the playing entity is used, known, treated, handled, built, or destroyed, etc. under the auspices of the scoping entity. The playing entity is passive in these roles in that the role exists without an agreement from the playing entity.   RoleClassMutualRelationship which are relationships based on mutual behavior of the two entities. The basis of these relationship may be formal agreements or they may bede facto behavior.  Thus, this sub-domain is further divided into:    RoleClassRelationshipFormal in which the relationship is formally defined, frequently by a contract or agreement.   Personal relationship which inks two people in a personal relationship. The hierarchy discussed above is represented In the current vocabulary tables as a set of abstract domains, with the exception of the  \"Personal relationship\" which is a leaf concept.  OpenIssue: Description copied from Concept Domain of same name.  Must be verified.',NULL,'v3 Code System RoleClass',1,'ValueSet/v3-RoleClass',NULL,'http://hl7.org/fhir/ValueSet/v3-RoleClass',495);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (626,NULL,'2017-09-27 09:59:42.411000',NULL,NULL,'  Description: Codes representing possible states of a RoleLink, as defined by the RoleLink class state machine.',NULL,'v3 Code System RoleLinkStatus',1,'ValueSet/v3-RoleLinkStatus',NULL,'http://hl7.org/fhir/ValueSet/v3-RoleLinkStatus',496);
