INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (661,NULL,'2017-09-27 09:59:43.877000',NULL,NULL,'  Definition: The type of consent directive, e.g. to consent or dissent to collect, access, or use in specific ways within an EHRS or for health information exchange; or to disclose  health information  for purposes such as research.',NULL,'ActConsentType',1,'ValueSet/v3-ActConsentType',NULL,'http://hl7.org/fhir/ValueSet/v3-ActConsentType',NULL);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (662,NULL,'2017-09-27 09:59:43.899000',NULL,NULL,' Sensitivity codes are not useful for interoperability outside of a policy domain because sensitivity policies are typically localized and vary drastically across policy domains even for the same information category because of differing organizational business rules, security policies, and jurisdictional requirements.  For example, an \"employee\" sensitivity code would make little sense for use outside of a policy domain.   \"Taboo\" would rarely be useful outside of a policy domain unless there are jurisdictional requirements requiring that a provider disclose sensitive information to a patient directly. Sensitivity codes may be more appropriate in a legacy system''s Master Files in order to notify those who access a patient''s orders and observations about the sensitivity policies that apply.  Newer systems may have a security engine that uses a sensitivity policy''s criteria directly. The specializable Sensitivity Act.code may be useful in some scenarious if used in combination with a sensitivity identifier and/or Act.title.',NULL,'InformationSensitivityPolicy',1,'ValueSet/v3-InformationSensitivityPolicy',NULL,'http://hl7.org/fhir/ValueSet/v3-InformationSensitivityPolicy',NULL);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (663,NULL,'2017-09-27 09:59:43.921000',NULL,NULL,' Types of security policies that further specify the ActClassPolicy value set.  Examples:   encrypt prohibit redisclosure without consent directive',NULL,'SecurityPolicy',1,'ValueSet/v3-SecurityPolicy',NULL,'http://hl7.org/fhir/ValueSet/v3-SecurityPolicy',NULL);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (664,NULL,'2017-09-27 09:59:43.943000',NULL,NULL,' Conveys the mandated workflow action that an information custodian, receiver, or user must perform.  Examples:   encrypt  Usage Note: Per OASIS XACML, an obligation is an operation specified in a policy or policy that is performed in conjunction with the enforcement of an access control decision.',NULL,'ObligationPolicy',1,'ValueSet/v3-ObligationPolicy',NULL,'http://hl7.org/fhir/ValueSet/v3-ObligationPolicy',NULL);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (665,NULL,'2017-09-27 09:59:43.966000',NULL,NULL,' Conveys prohibited actions which an information custodian, receiver, or user is not permitted to perform unless otherwise authorized or permitted under specified circumstances.  Examples:   prohibit redisclosure without consent directive',NULL,'RefrainPolicy',1,'ValueSet/v3-RefrainPolicy',NULL,'http://hl7.org/fhir/ValueSet/v3-RefrainPolicy',NULL);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (666,NULL,'2017-09-27 09:59:43.988000',NULL,NULL,' Supports communication of purpose of use at a general level.',NULL,'PurposeOfUse',1,'ValueSet/v3-PurposeOfUse',NULL,'http://hl7.org/fhir/ValueSet/v3-PurposeOfUse',NULL);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (667,NULL,'2017-09-27 09:59:43.999000',NULL,NULL,' Supports communication of purpose of use at a general level.',NULL,'GeneralPurposeOfUse',1,'ValueSet/v3-GeneralPurposeOfUse',NULL,'http://hl7.org/fhir/ValueSet/v3-GeneralPurposeOfUse',NULL);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (668,NULL,'2017-09-27 09:59:44.012000',NULL,NULL,' Security observation values used to indicate security control metadata.  V:SecurityControl is the union of V:SecurityPolicy,V:ObligationPolicy, V:RefrainPolicy, V:PurposeOfUse, and V:GeneralPurpose of Use used to populate the SecurityControlObservationValue attribute in order to convey one or more nonhierarchical security control metadata dictating handling caveats, purpose of use, dissemination controls and other refrain policies, and obligations to which a custodian or receiver is required to comply.',NULL,'SecurityControlObservationValue',1,'ValueSet/v3-SecurityControlObservationValue',NULL,'http://hl7.org/fhir/ValueSet/v3-SecurityControlObservationValue',NULL);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (669,NULL,'2017-09-27 09:59:44.018000',NULL,NULL,' A named tag set for metadata used to populate a security category label field that \"segments\" an IT resource per policy by indicating that access and use is restricted to members of a defined community or project. (HL7 Healthcare Privacy and Security Classification System)  Usage Note: This is the healthcare analog to the US Intelligence Community''s concept of a Special Access Program.  Compartment codes may be used in as a field value in an initiator''s clearance to indicate permission to access and use an IT Resource with a security label having the same compartment value in security category label field. Map: Aligns with ISO 2382-8 definition of Compartment -  \"A division of data into isolated blocks with separate security controls for the purpose of reducing risk.\"',NULL,'Compartment',1,'ValueSet/v3-Compartment',NULL,'http://hl7.org/fhir/ValueSet/v3-Compartment',NULL);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (670,NULL,'2017-09-27 09:59:44.040000',NULL,NULL,'No Description Provided',NULL,'SecurityIntegrityObservationValue',1,'ValueSet/v3-SecurityIntegrityObservationValue',NULL,'http://hl7.org/fhir/ValueSet/v3-SecurityIntegrityObservationValue',NULL);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (671,NULL,'2017-09-27 09:59:44.050000',NULL,NULL,' Specifies the state change of a target Act, using ActStatus codes, from its previous state as a predecessor Act. For example, if the target Act is the result of a predecessor Act being \"obsoleted\" and replaced with the target Act, the source ProvenanceEventCurrentState Act code would be \"obsoleted\".',NULL,'ProvenanceEventCurrentState-AS',1,'ValueSet/v3-ProvenanceEventCurrentState-AS',NULL,'http://hl7.org/fhir/ValueSet/v3-ProvenanceEventCurrentState-AS',NULL);
INSERT INTO ValueSet (VALUESET_ID,RES_DELETED,RES_CREATED,RES_MESSAGE_REF,RES_UPDATED,description,CODESYSTEM_URL,VALUESET_NAME,status,VALUESET_STRID,title,url,CODESYSTEM_PID) VALUES (672,NULL,'2017-09-27 09:59:44.059000',NULL,NULL,' Specifies the state change of a target Act using DocuymentCompletion codes, from its previous state as a predecessor Act. For example, if the target Act is the result of a predecessor Act being \"obsoleted\" and replaced with the target Act, the source ProvenanceEventCurrentState Act code would be \"obsoleted\".',NULL,'ProvenanceEventCurrentState-DC',1,'ValueSet/v3-ProvenanceEventCurrentState-DC',NULL,'http://hl7.org/fhir/ValueSet/v3-ProvenanceEventCurrentState-DC',NULL);
